//Write a C program to display the sum of first n terms of Fibonacci series.
//Using for loop
#include <stdio.h>
#include <math.h>
int main()
{
      int f1,f2,f3,n,i,s=1;
      f1=0;
      f2=1;
      scanf("%d",&n);
      for(i=2;i<n;i++)
      {
            f3=f1+f2;
            f1=f2;
            f2=f3;
            s=s+f3;
      }
      printf("Sum of %d terms of Fibonacci Series is : %d",n,s);
      return 0;
}
